import { ProfileType } from "./WhatProfile";
// Here are the icons, in base64

// Mojang official
const MOJANG =
  "data:image/png;base64,";

// Bad Forge
const FORGE =
  "data:image/png;base64,";

// Good Fabric!
const FABRIC =
  "data:image/png;base64,";
// Not recognized
const UNIVERSIAL =
  "data:image/png;base64,";

export function getIconFor(type: ProfileType): string {
  switch (type) {
    case ProfileType.FABRIC:
      return FABRIC;
    case ProfileType.MOJANG:
      return MOJANG;
    case ProfileType.FORGE:
      return FORGE;
    case ProfileType.UNIVERSAL:
      return UNIVERSIAL;
  }
}
